@Override
public boolean transferNode(Stmt stmt, SetFact in, SetFact out) {
    // TODO - finish me
    Optional def = stmt.getDef();
    List uses = stmt.getUses();
    SetFact inCopy = in.copy();


    // 当前节点的OUT拷贝一份防止修改
    SetFact outCopy = out.copy();

    // 当前节点OUTCopy先删除重定义的变量
    def.ifPresent(lValue -> {
        if (lValue instanceof Var) {
            outCopy.remove(((Var) lValue));
        }
    });


    // 当前节点OUTCopy再加入使用的变量
    for (RValue use : uses) {
        if (use instanceof Var) {
            outCopy.add((Var) use);
        }
    }

    // 清空IN，放入计算后的OUT
    in.clear();
    in.union(outCopy);

    // 如果原来的INCopy和当前的IN不一致，则有改动需要继续循环
    return !inCopy.equals(in);
}

